import { HexColorPicker } from "react-colorful";
import "./colorPicker.css";

const colorList = [{
    id : 1,
    name : "white",
    hex : "#ffffff"
},
{
    id : 2,
    name : "black",
    hex : "#000000"
},
{
    id : 3,
    name : "red",
    hex : "#ff0000"
},
{
    id : 4,
    name : "blue",
    hex : "#00ff00"
},
{
    id : 5,
    name : "green",
    hex : "#0000ff"
}
]

function Colorpicker({ color, setColor }) {
  return (
    <div className="colorPicker-wrapper">
      <HexColorPicker color={color} onChange={setColor} />
      <select>
        {colorList.map(val=><option key={val.id} value={val.name}>{val.name}</option>)}
      </select>
    </div>
  );
}

export default Colorpicker;
